using System;

namespace AOC._2018
{
    class Day5
    {
        //readonly string _input = @"dabAcCaCBAcCcaDA"

        string _input = @"";

        private static bool Pass(ref string current)
        {
            for (int i = 0; i < current.Length - 1; i++)
            {
                char a = current[i];
                char b = current[i + 1];
                if (AreOpposite(a, b))
                {
                    current = current.Remove(i, 2);
                    return true;
                }
            }
            return false;
        }

        private static bool AreOpposite(char a, char b) => Math.Abs(a - b) == 32;

        public string Task1()
        {
            while (Pass(ref _input)) 
            { 
                //
            }
            return _input.Length.ToString();
        }


        public string Task2()
        {
            int shortest = _input.Length;
            string tests = "abcdefghijklmnopqrstuvwxyz";

            for (int i = 0; i < tests.Length; i++)
            {
                string current = _input.Replace(tests[i].ToString(), "").Replace(tests[i].ToString().ToUpper(), "");
                while (Pass(ref current)) 
                {
                    //
                }
                if (current.Length < shortest) shortest = current.Length;
            }

            return shortest.ToString();
        }
    }
}
